import java.lang.System;public class tsp {	public static void main(String[] args) {		FileReader.readFile("files/trainfile3.txt");		long start = System.nanoTime();		for (City c : Utilities.cities) {			c.setDistances();		}		long end = System.nanoTime();		System.out.println ("Runtime: " + (end - start) + " nanoseconds");		for (City c : Utilities.cities) {			System.out.print ("City " + c.getIndex() + ": ");			for (int i = 0; i < c.getCityTo().size(); i++) {				System.out.print ("distance to: " + c.getCityTo().get(i) + ": ");				System.out.println (c.geteDistance().get(i));			}		}	}}